import React from 'react'
import productos from '../produtos.json'
import Card from '../components/card'


const Listado = () =>{
    return (
        
         <div className = "row">
             {productos.map(((items,index)=>(
                 <div key = {index} className = "col-4">
                    <Card data = {items}/>
                 </div>
             )))}
            
         </div>
            
    )
}


export default Listado
